import Cases from "./aboutComps/Cases";
import Top from "./aboutComps/Top";
import Join from "./aboutComps/Join";

function About() {
  return (
    <>
      <main>
        <div>
          <IntroSect  About />
          <Cases />
          <Top />
          <Join />
        </div>
      </main>
    </>
  )
}

export default About;
